import "./footer.css";

function Footer() {
  return (
    <>
      <div className="Apps">
        <footer className="footer">
          <div className="header-divs"></div>
          Coded by
          <a className="link" href="https://twitter.com/aminat_adenuga">
            Corazon|DEV
          </a>
          .
        </footer>
      </div>
    </>
  );
}
export default Footer;
